  let path = "/dialogs/" + props.id;
  return (
    <div className={classes.dialog + ' ' + classes.active}>
      <NavLink to={path}>{props.name}</NavLink>
    </div>
  )
}

const Message = (props) => {
  return (
    <div className={classes.message}>{props.message}</div>
  )
}

const Dialogs = (props) => {
  let dialogsData = [
    {id: 1, name: 'Irina'},
    {id: 2, name: 'Victor'},
    {id: 3, name: 'Yuriy'},
    {id: 4, name: 'Olha'},
    {id: 5, name: 'Yliana'},
    {id: 6, name: 'Sulik'}
